import './styles.css';
import React from 'react'
import range from 'lodash/range'
import * as selectors from '../../actions/babies'
import { connect } from 'react-redux';
import { getAllBabies } from '../../reducers/babies';

const Baby = ({babies,}) => (
    <div className="container">
        <div className="baby">
        <select id="cars" name="cars">
            {range(babies.length).map(
                    (_,index) => (
                        <option value={babies[index][0]}>{babies[index][1]+" "+babies[index][2]}</option>
                    )
                )}
        </select>
        </div>
    </div>
)

export default connect(
    state => ({
        babies: selectors.getAllBabies(state)
    }),
    undefined
)(Baby)
